import ProvisionedService from "../types/provisioned-service";

/**
 * Mock client for retrieving and parsing Provisioned Services.
 */
export default class MockProvisionedServiceClient {
  /**
   * Retrieve a {@link ProvisionedService} from a namespace, by name.
   * @returns {ProvisionedService}
   */
  static getProvisionedService() {
    const identifier = MockProvisionedServiceClient._randomIdentifier();
    return new ProvisionedService(`mock-service-${identifier}`, `https://mock-service-${identifier}.com/`, `mock-service-${identifier}-name`);
  }

  /**
   * Retrieve a randomly named {@link ProvisionedService}
   * @returns {ProvisionedService[]}
   */
  static listProvisionedServices() {
    return [this.getProvisionedService(), this.getProvisionedService(), this.getProvisionedService];
  }

  /**
   * Generate a random identifier for the client.
   * @private
   * @returns {number}
   */
  static _randomIdentifier() {
    return Math.floor(Math.random() * (9999 - 1000 + 1)) + 1000;
  }
}

import ClusterServiceClass from "../types/cluster-service-class";
import ServiceInstance from "../types/service-instance";
import ProvisionedService from "../types/provisioned-service";

/**
 * Client for retrieving and parsing Provisioned Services.
 */
export default class ProvisionedServiceClient {
  /**
   * Construct a {@link ProvisionedServiceClient}
   * @constructor
   * @param {string} openshiftURL
   */
  constructor(openshiftURL) {
    this.openshiftURL = openshiftURL;
  }

  /**
   * Retrieve a {@link ProvisionedService} from a namespace, by name.
   * @param {string} authToken The auth token for a user.
   * @param {string} namespace The namespace to find the service in.
   * @param {string} name The name of the service to retrieve.
   */
  getProvisionedService(authToken, namespace, name) {
    return this.listProvisionedServices(authToken, namespace)
      .then((provisionedServices) => {
        if (!provisionedServices || (provisionedServices.length === 0)) {
          return Promise.reject(new Error(`Provisioned service with the name ${name} not found in namespace ${namespace}`));
        }
        return provisionedServices.find(provisionedService => provisionedService.name === name);
      })
      .then((provisionedService) => {
        if (!provisionedService) {
          return Promise.reject(new Error(`Provisioned service with the name ${name} not found in namespace ${namespace}`));
        }
        return provisionedService;
      });
  }

  /**
   * Retrieve a list of {@link ProvisionedService} from a namespace.
   * @param {string} authToken
   * @param {string} namespace
   */
  listProvisionedServices(authToken, namespace) {
    return Promise.all([
      this._listClusterServiceClasses(this.openshiftURL, authToken),
      this._listServiceInstances(this.openshiftURL, authToken, namespace)])
      .then(([clusterServiceClasses, serviceInstances]) => {
        if (!serviceInstances || (serviceInstances.length === 0)) {
          return [];
        }
        return serviceInstances.map((serviceInstance) => {
          const displayName = clusterServiceClasses.find(serviceClass => serviceClass.name === serviceInstance.clusterServiceClassId);
          return new ProvisionedService(serviceInstance.name, serviceInstance.consoleURL, displayName);
        });
      });
  }

  /**
   * Retrieve a list of {@link ServiceInstance} from a namespace in OpenShift.
   * @private
   * @param {string} openshiftURL An OpenShift URL.
   * @param {string} authToken An auth token for a user.
   * @param {string} namespace The namespace to list the service instances from.
   * @returns {Promise<ServiceInstance[]>}
   */
  _listServiceInstances(openshiftURL, authToken, namespace) {
    if (!authToken) {
      return Promise.reject(new Error("Auth token should not be null"));
    }

    const headers = new Headers({
      'Authorization': `Bearer ${authToken}`
    });
    return fetch(ProvisionedServiceClient._buildServiceInstanceListRoute(openshiftURL, namespace), { headers: headers })
      .then(response => response.json())
      .then(jsonData => jsonData.items.map(serviceInstanceJSON => ServiceInstance.fromJSON(serviceInstanceJSON)));
  }

  /**
   * Retrieve a list of {@link ClusterServiceClass} in OpenShift.
   * @private
   * @param {string} openshiftURL An OpenShift URL.
   * @param {string} authToken An auth token for a user.
   * @returns {Promise<ClusterServiceClass[]>}
   */
  _listClusterServiceClasses(openshiftURL, authToken) {
    if (!authToken) {
      return Promise.reject(new Error("Auth token should not be null"));
    }

    const headers = new Headers({
      'Authorization': `Bearer ${authToken}`
    });
    return fetch(ProvisionedServiceClient._buildClusterServiceClassListRoute(openshiftURL), { headers: headers })
      .then(response => response.json())
      .then(jsonData => jsonData.items.filter(serviceClassJSON => ClusterServiceClass.isValidJSON(serviceClassJSON)))
      .then(jsonData => jsonData.map(serviceClassJSON => ClusterServiceClass.fromJSON(serviceClassJSON)));
  }

  /**
   * Return a valid route for retrieving service instances from OpenShift.
   * @private
   * @param {string} openshiftURL The URL of OpenShift
   * @param {string} namespace The namespace to retrieve the service instances from
   */
  static _buildServiceInstanceListRoute(openshiftURL, namespace) {
    return `${openshiftURL}/apis/servicecatalog.k8s.io/v1beta1/namespaces/${namespace}/serviceinstances`;
  }

  /**
   * Build a valid route for retrieving cluster service classes from OpenShift.
   * @private
   * @param {string} openshiftURL The URL of OpenShift
   */
  static _buildClusterServiceClassListRoute(openshiftURL) {
    return `${openshiftURL}/apis/servicecatalog.k8s.io/v1beta1/clusterserviceclasses`;
  }
}

import ProvisionedService from "./types/provisioned-service";
import ProvisionedServiceClient from "./clients/provisioned-service-client";
import MockProvisionedServiceClient from "./clients/mock-provisioned-service-client";

/**
 * Provides a set of functions for retrieving various OpenShift resources and
 * parsing them into a specific format.
 */
export default class OpenShiftResourceParser {
  /**
   * Construct a new {@link OpenShiftResourceParser}
   * @param {Object} config Configuration for the parser.
   * @param {string} config.openshiftURL The URL of OpenShift.
   * @param {boolean} config.mockData Whether the parser should use mock data or not.
   */
  constructor(config) {
    this.config = config;
    this.provisionedServiceClient = new ProvisionedServiceClient(this.config.openshiftURL);
  }

  /**
   * Get a ProvisionedService from a specified namespace, by name.
   * @param {string} authToken An auth token for a user.
   * @param {string} namespace The namespace to find the service in.
   * @param {string} serviceName The name of the service to retrieve.
   * @returns {Promise<ProvisionedService>}
   */
  getProvisionedMWService(authToken, namespace, serviceName) {
    if (this.config.mockData) {
      return MockProvisionedServiceClient.getProvisionedService();
    }
    return this.provisionedServiceClient.getProvisionedService(authToken, namespace, serviceName);
  }

  /**
   * Retrieve a list of provisioned services in a namespace.
   * @param {string} authToken
   * @param {string} namespace
   * @returns {Promise<ProvisionedService>}
   */
  listProvisionedMWServices(authToken, namespace) {
    if (this.config.mockData) {
      return MockProvisionedServiceClient.listProvisionedServices();
    }
    return this.provisionedServiceClient.listProvisionedServices(authToken, namespace);
  }
}

export default class ClusterServiceClass {
  /**
   * Construct a new {@link ClusterServiceClass}
   * @param {string} name The identifying name of the cluster service class
   * @param {string} displayName The human-friendly name of the cluster service class
   */
  constructor(name, displayName) {
    this.name = name;
    this.displayName = displayName;
  }

  /**
   * Return whether the provided JSON data is parsable by @see fromJSON 
   * This returning false does not mean the actual object is invalid in OpenShift.
   * @param {Object} jsonData The JSON object to check
   * @returns {boolean} 
   */
  static isValidJSON(jsonData) {
    return (jsonData && jsonData.metadata && jsonData.metadata.name &&
      jsonData.spec && jsonData.spec.externalMetadata && jsonData.spec.externalMetadata.displayName)
  }

  /**
   * Create a new {@link ClusterServiceClass} from a provided JSON object.
   * @param {Object} jsonData The JSON object to parse
   * @returns {ClusterServiceClass}
   */
  static fromJSON(jsonData) {
    return new ClusterServiceClass(jsonData.metadata.name, jsonData.spec.externalMetadata.displayName);
  }
}

export default class ProvisionedService {
  /**
   * Construct a new {@link ProvisionedService}.
   * @constructor
   * @param {string} name The name of the service
   * @param {string} consoleURL The dashboard URL of the service
   * @param {ClusterServiceClass} service The cluster service class
   */
  constructor(name, consoleURL, service) {
    this.name = name;
    this.consoleURL = consoleURL;
    this.service = service;
  }
}

export default class ServiceInstance {
  constructor(name, consoleURL, clusterServiceClassId) {
    this.name = name;
    this.consoleURL = consoleURL;
    this.clusterServiceClassId = clusterServiceClassId;
  }

  static fromJSON(jsonData) {
    const { name } = jsonData.metadata;
    const consoleURL = jsonData.status.dashboardURL;
    const clusterServiceClassId = jsonData.spec.clusterServiceClassRef.name;

    return new ServiceInstance(name, consoleURL, clusterServiceClassId);
  }
}
